(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d2088c9"],{a4ee:function(e){e.exports=JSON.parse('{"name":"Dynamic Programming","description":"Dynamic programming, like the divide-and-conquer method, solves problems by combining the solutions to subproblems. A dynamic-programming algorithm solves each subproblem just once and then saves its answer in a table, thereby avoiding the work of recomputing the answer every time it solves each subproblem.","items":[{"tags":["dp"],"title":"动态规划笔记","excerpt":"例题：[洛谷P1833 樱花](https://www.luogu.com.cn/problem/P1833)","updated_at":"2020-07-29T16:27:47+08:00","created_at":"2020-07-29T16:27:47+08:00","url":"/docs/course/dp"},{"tags":["bfs","dp"],"title":"洛谷P2901 Cow Jogging G","excerpt":"贝西终于尝到了懒惰的后果，决定每周从谷仓到池塘慢跑几次来健身。当然，她不想跑得太累，所以她只打算从谷仓慢跑下山到池塘，然后悠闲地散步回谷仓。","updated_at":"2020-07-29T16:27:47+08:00","created_at":"2020-07-29T16:27:47+08:00","url":"/docs/acm/search/luogu-2901"},{"tags":["dfs","dp"],"title":"洛谷P3052 [USACO12MAR] Cows in a Skyscraper G","excerpt":"A little known fact about Bessie and friends is that they love stair climbing races. A better known fact is that cows really don\'t like going down stairs. So after the cows finish racing to the top of their favorite skyscraper, they had a problem. Refusing to climb back down using the stairs, the cows are forced to use the elevator in order to get back to the ground floor.","updated_at":"2020-07-29T16:27:47+08:00","created_at":"2020-07-29T16:27:47+08:00","url":"/docs/acm/search/luogu-3052"}],"url":"/tags/dp"}')}}]);
